def korney(a):
    inf = float('inf')
    xors_by_a = {0: [0]}
    a_by_xor = {0: 0}
    used_a = [0]
    recent = set()
    for ai in a:
        if len(a_by_xor.keys()) == 512:
            break
        if ai in recent:
            continue
        else:
            recent.add(ai)
        changed = False
        for aj in used_a:
            if aj >= ai:
                break
            for existing_xor in xors_by_a[aj]:
                new_xor = ai ^ existing_xor
                if a_by_xor.get(new_xor, inf) > ai:
                    a_by_xor[new_xor] = ai
                    changed = True
        if changed:
            xors_by_a = recreate_xors_by_a(a_by_xor)
            used_a = sorted(xors_by_a.keys())
            recent = set()
    print(len(a_by_xor.keys()))
    print(' '.join(map(str, sorted(a_by_xor.keys()))))

def recreate_xors_by_a(a_by_xor):
    xors_by_a = {}
    for (xor_value, a) in a_by_xor.items():
        if a in xors_by_a:
            xors_by_a[a] += [xor_value]
        else:
            xors_by_a[a] = [xor_value]
    return xors_by_a
